import AppLayout from "../front/component/AppLayout";
import Head from 'next/head';

const Profile = () => {
    return(
        <>
        <Head><title>my profile</title></Head>
        <AppLayout><div>Profile</div></AppLayout>
        </>
    )    
}
export default Profile;
